  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:50.006743\",\n\t\"name\": \"prescribed-burning-plan-for-fy-1988-parker-river-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is the 1988 prescribed burning plan
  for Parker River National Wildlife Refuge. Treatment #1 is the area consisting of
  the fresh water marsh inside the Stage Island Pool. Much of the aquatic vegetation
  in Stage Island Pool was treated with an herbicide in August, 1987. The purpose
  of the prescribed burn is to remove past years' accumulation of dead organic matter
  and the dead standing vegetation treated this past summer with herbicide, releasing
  the nutrients back into the soil and allowing the sun's light to stimulate early
  plant growth. This prescribed burn is an integral part of the lead shot reduction
  plan that started during summer, 1985.  The primary fuels, approximately 95 percent,
  to be burned are Giant Reed, Purple Loosestrife, and Cattail.  These fine to light
  fuels are found in pure species stands or in varying densities of combinations with
  one another.  Treatment #2 is Weare Camp at the Knobbs.  The camp will be burned
  during January, weather conditions permitting.  The camp will be ignited at the
  base with a flammable liquid.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
